  "Character": "\uD83D\uDC0Fငယ်ငယ်လေးတည်းကထိန်းရမလွယ်ကြောလေးတွေပါ။ စကားသိပ်နားမထောင်ဘူး သူတို့လုပ်ချင်ဆိုလုပ်လိုက်ရမှမဟုတ်ရင် ဂျီတွန်ပါလေရော။ ပညာရေးဖက်မှာဆိုလည်း သိပ်စိတ်မပါကြတာများတော့ လူကြီးတွေခမျာရင်တမမနဲ့လိုက်ထိန်းရတဲ့ ငယ်ဘဝအချိန်တွေပေါ့။ ကြီးလာတော့လည်းသူ့သူတော့အဆင်ပြေသွားတာပါပဲ။ Mecury Aries တို့ကအတွေးအရမ်းမြန်တာ ဘာရယ်မဟုတ်တစ်ခုခုဆိုဖြန်းဆိုအတွေးထဲရောက်ပြီ။ သူတို့တွေးချင်သလိုတွေတွေးပလိုက်တာပဲ။ အကြောင်းအရင်းသေချာမသိလည်း ကိုယ်ထင်သလိုလေးဖြည့်တွေးချပလိုက်တာသူတို့တွေပါ။ တွေးတယ်ဆိုတာကလေဖြစ်နေတာရဲ့အဓိကအကြောင်းအရင်းကို တွေးတာမျိုးမဟုတ်ပဲသူမြင်နေရတဲ့ အခြေအနေပေါ်မှဒီလိုတော့ဖြစ်မယ်ဆိုပြီးကောက်ချက်ချပလိုက်တာ။ တစ်ယောက်ကတစ်ယောက်ကိုအနိုင်ကျင့်နေတာမြင်ရင် ဘာလို့အနိုင်ကျင့်နေတာလဲမသိဘူး ဆိုပြီးမြင်တဲ့ပေါ်မှာထင်မြင်ချက်ထုတ်တတ်ကြတာမျိုးပါ။\r\n\r\n\uD83D\uDC0Fအကြံတွေအများကြီးရှိတတ်တဲ့သူတွေပေါ့။ အခက်အခဲတစ်ခုရင်ဆိုင်ရပြီဆိုလည်း ဘယ်လိုမျိုးကောင်းကောင်းကျော်ဖြတ်ရမလဲဆိုတာသူတို့သိတယ်။ တစ်ခုခုဆိုသူတို့ဖက်ကနေစပြီးလုပ်ချင်တတ်သူတွေမို့ အချိန်ဆွဲမနေပဲမြန်မြန်နဲ့ပြီးသွားအောင် အချိန်ခဏလေးအတွင်းမှာဘယ်လိုဖြစ်တာလဲ ဘယ်လိုလုပ်လို့ရလဲအတွေးထဲတန်းစီပြီတွေးနှင့်ပြီးပြီ။ ချက်ချင်းပဲဘာလုပ်မယ်ဆိုတဲ့ဆုံးဖြတ်ချက်ကိုလည်း အမြန်ချပြီးလုပ်တော့တာပါ။ ခုဖတ်နေတာကတောင်ပိုကြာနေအုန်းမယ် သူတို့လုပ်လိုက်တာကခဏလေးပဲ။ ခပ်မြန်မြန်ပဲလုပ်ရတာဆုံးဖြတ်ရတာကအကျင့်တစ်ခုဖြစ်နေတာ။ နှေးကွေးနေတာတွေဆို အကြိုက်မတွေ့ဘူး။\r\n\r\n\uD83D\uDC0Fသူတို့ကိုကြည့်လိုက်ရင်အမြဲလိုလို မြန်မြန်ဆန်ဆန်တွေလုပ်နေတာကိုတွေ့ရတတ်တယ်။ ဘာပဲလုပ်လုပ်လျင်မြန်နေတဲ့သူတွေမို့ တခါတခါလောကြီးနေသလားတောင်ထင်ရမယ်။ စကားပြောတဲ့ချိန်တို့ဆိုလည်း လေပေါ်လက်တွေဝဲနေတတ်တဲ့သူတွေပါ။ လက်အမူအရာတွေအများကြီးပါပြီး ပြောတတ်တာမို့ဘေးနားကသူကတော့ ဟားဟားဆိုတစ်ချက် သိလားဆိုနောက်တစ်ချက် ဟုတ်တယ်မှန်တယ်ဆိုတစ်ချက် အဆွဲခံရတတ်ပါတယ်။ လက်လည်းအြန်သလိုပါးစပ်လေးကလည်း အသွက်လေးပါပဲ။ စကားပြောလည်းမြန်ပြီး rapper တွေရဲ့ပိုးများပါလာလားထင်ရတယ်။ ပြောပြီးဆိုရင်တောက်လျှောက်ကိုပြောတာအဆက်မပြတ် သူကတော့မသိဘူးဘေးလူတွေဖို့တော့ နားမလည်ကျတာများတယ်။ ပြီးတော့အကြောင်းအရာအများကြီးကို ဆက်ပြီးပြောတော့နားထောင်တဲ့သူတွေက အရှေ့ကဟာကိုနားလည်ဖို့ကြိုးစားတုန်း သူကအသစ်ပြောနေတော့ချာလည်လည်ကုန်ရော။\r\n\r\n\uD83D\uDC0Fစကားပွကြတဲ့သူတွေပေါ့လေ ဘာပြောနေမှန်းမသိတချက်ချက်ပြောနေတာနဲ့မဆိုင်တာတွေလည်း ထည့်ပြောချင်ပြောကြတာ။ နည်းနည်းလေးစုစုစည်းစည်းလေးနဲ့ ပြောတတ်အောင်တော့လေ့ကျင့်စေချင်တယ်။ တခါတလေသူပြောချင်တာကတစ်ခု ပြောနေတာကတစ်ခု စိတ်ထဲမပါပဲလည်းပြောထွက်သွားတာတွေကများတယ်။ အတွေးမြန်တယ်ဆိုပေမယ့် လှုပ်ရှားမှုတွေကပိုမြန်ကြတယ်။ လုပ်မယ်လို့တွေးမဆုံးသေးဘူး လက်ကပါသွားနှင့်ပြီ။ လုပ်ချင်ရင်ချက်ချင်းခုဆိုခုဆိုတဲ့သူတွေမို့ သူတို့နောက်ကိုမလိုက်နိုင်တဲ့သူတွေစီကနေ မေတ္တာခဏခဏအပို့ခံကြရပါတယ်။\r\n\r\n\uD83D\uDC0Fစိတ်မြန်လက်မြန်သူတွေမို့သူတို့ကိုနည်းနည်းလေး ချိန်းလားခြောက်လားလုပ်တယ်ထင်ပြီဆိုရင် ပြန်စွာပြီသာမှတ်နည်းနည်းလေးမှအထိမခံဘူး ပြန်ပြောလိုက်ရမှ။ အဲ့တာကြောင့်ပဲအများစုကထင်တာ သူတို့ကလူကြမ်းကြီးတွေပေါ့ အားနေခင်မို့မို့ဇာတ်သွင်းခံရတဲ့သူလေးတွေပါ။ ဒေါသကြီးစိတ်ကြီးတယ်သွားမထိနဲ့ ဆိုပြီးနောက်ကွယ်မှာပြောကျဆိုကျထင်ကြတာများတယ်။ စိတ်ငြိမ်နေလည်းအထင်ခံရတာပဲ။ စကားပြောရင်လည်းတည့်ဆန်ကြတယ်။ လှတပတတွေပြောမနေတတ်ဘူး ကြားကောင်းတာတွေလည်းစိတ်သိပ်မဝင်စားဘူး ရိုးရိုးလေးပဲပြောတယ် ပြောချင်တဲ့အဓိကအချက်ကိုရောက်ရင်ပြီးပြီ အချိန်တွေအကြာကြီးလည်းဆွဲပြီးပြောမနေဘူး။\r\n\r\n\uD83D\uDC0Fအရှိကိုအရှိတိုင်းနေတာလေးကတော့ ကောင်းတဲ့အချက်လေးပေါ့။ မသိရင်မသိဘူးပဲဘာမှသိသယောင်တွေလုပ်မနေဘူး။ ရိုးရိုးသားသားပဲနေကြတာ။ ဗွင်းဗွင်းရှင်းရှင်းသမားတွေမို့ ပြောချင်တယ်ဆိုပြောချလိုက်တာပဲ တစ်ဖက်သူကြားရတာနားထောင်ကောင်းရဲ့လား ဘယ်လိုထင်သွားနိုင်လဲတွေသိပ်မစဥ်းစားနေဘူး။ ကောင်းရင်ကောင်းတယ်မကောင်းရင်မကောင်းဘူးတည့်ပဲပြောတာ။ မြန်မြန်ဆန်ဆန်လုက်ရတာမျိုးဆိုသိပ်ကြိုက် တစ်ခုခုအလျင်လိုတယ်မလားသူသာပြော လုပ်ပေးလိုက်လိမ့်မယ်မဟုတ်လည်း ဘာလုပ်ဘာလုပ်ချက်ချင်းပြောလိုက်မှာ။ စောင့်နေရတာကသူတို့အတွက်ငရဲတစ်မျိုးပဲ။ စောင့်ရဝါသနာသိပ်မပါကြဘူး။\r\n\r\n\uD83D\uDC0Fငြင်းရတာလေးတော့ဝါသနာပါတာပေါ့ ဒါမယ့်နော်နိုင်နိုင်ချေရှိတယ်ဆိုမှငြင်းမှာ နိုင်မယ်ထင်တဲ့သူနဲ့ပဲငြင်းတယ်မဟုတ်ရင်တော်ရုံလောက်ပဲ။ Mercury Aries တို့ကလေတခါတလေကျပြဿနာမီးခွက် ထွန်းရှာတဲ့နေရာမှာတော့ ကျွမ်းပိတွေ။ သူတို့ထက်အကြီးတွေကိုလည်း သိပ်မမှုဘူးပြောမယ်ဆိုမယ်ဆိုတာကြီးပဲ။ အလုပ်ခွင်မှာအဲ့တာကပြဿနာ ရာထူးကြီးတဲ့သူတွေနဲ့လည်းမတည့်ဘူး စကားမများဘူးတဲ့သူဆိုတာမရှိသလောက်ပဲ။ သူတို့ကိုနည်းနည်းလေးပုတ်ခတ်တယ်ထင်လာရင်ကို ပြဿနာသွားရှာပစ်တာ။\r\n\r\n\uD83D\uDC0Fအတွေးလေးတစ်ခုခေါင်းထဲရောက်လာရင် ဘာတွေလ