    "Character": "\uD83D\uDC0Fငယ်ငယ်လေးတည်းကထိန်းရမလွယ်ကြောလေးတွေပါ။ စကားသိပ်နားမထောင်ဘူး သူတို့လုပ်ချင်ဆိုလုပ်လိုက်ရမှမဟုတ်ရင် ဂျီတွန်ပါလေရော။ ပညာရေးဖက်မှာဆိုလည်း သိပ်စိတ်မပါကြတာများတော့ လူကြီးတွေခမျာရင်တမမနဲ့လိုက်ထိန်းရတဲ့ ငယ်ဘဝအချိန်တွေပေါ့။ ကြီးလာတော့လည်းသူ့သူတော့အဆင်ပြေသွားတာပါပဲ။ Mecury Aries တို့ကအတွေးအရမ်းမြန်တာ ဘာရယ်မဟုတ်တစ်ခုခုဆိုဖြန်းဆိုအတွေးထဲရောက်ပြီ။ သူတို့တွေးချင်သလိုတွေတွေးပလိုက်တာပဲ။ အကြောင်းအရင်းသေချာမသိလည်း ကိုယ်ထင်သလိုလေးဖြည့်တွေးချပလိုက်တာသူတို့တွေပါ။ တွေးတယ်ဆိုတာကလေဖြစ်နေတာရဲ့အဓိကအကြောင်းအရင်းကို တွေးတာမျိုးမဟုတ်ပဲသူမြင်နေရတဲ့ အခြေအနေပေါ်မှဒီလိုတော့ဖြစ်မယ်ဆိုပြီးကောက်ချက်ချပလိုက်တာ။ တစ်ယောက်ကတစ်ယောက်ကိုအနိုင်ကျင့်နေတာမြင်ရင် ဘာလို့အနိုင်ကျင့်နေတာလဲမသိဘူး ဆိုပြီးမြင်တဲ့ပေါ်မှာထင်မြင်ချက်ထုတ်တတ်ကြတာမျိုးပါ။\r\n\r\n\uD83D\uDC0Fအကြံတွေအများကြီးရှိတတ်တဲ့သူတွေပေါ့။ အခက်အခဲတစ်ခုရင်ဆိုင်ရပြီဆိုလည်း ဘယ်လိုမျိုးကောင်းကောင်းကျော်ဖြတ်ရမလဲဆိုတာသူတို့သိတယ်။ တစ်ခုခုဆိုသူတို့ဖက်ကနေစပြီးလုပ်ချင်တတ်သူတွေမို့ အချိန်ဆွဲမနေပဲမြန်မြန်နဲ့ပြီးသွားအောင် အချိန်ခဏလေးအတွင်းမှာဘယ်လိုဖြစ်တာလဲ ဘယ်လိုလုပ်လို့ရလဲအတွေးထဲတန်းစီပြီတွေးနှင့်ပြီးပြီ။ ချက်ချင်းပဲဘာလုပ်မယ်ဆိုတဲ့ဆုံးဖြတ်ချက်ကိုလည်း အမြန်ချပြီးလုပ်တော့တာပါ။ ခုဖတ်နေတာကတောင်ပိုကြာနေအုန်းမယ် သူတို့လုပ်လိုက်တာကခဏလေးပဲ။ ခပ်မြန်မြန်ပဲလုပ်ရတာဆုံးဖြတ်ရတာကအကျင့်တစ်ခုဖြစ်နေတာ။ နှေးကွေးနေတာတွေဆို အကြိုက်မတွေ့ဘူး။\r\n\r\n\uD83D\uDC0Fသူတို့ကိုကြည့်လိုက်ရင်အမြဲလိုလို မြန်မြန်ဆန်ဆန်တွေလုပ်နေတာကိုတွေ့ရတတ်တယ်။ ဘာပဲလုပ်လုပ်လျင်မြန်နေတဲ့သူတွေမို့ တခါတခါလောကြီးနေသလားတောင်ထင်ရမယ်။ စကားပြောတဲ့ချိန်တို့ဆိုလည်း လေပေါ်လက်တွေဝဲနေတတ်တဲ့သူတွေပါ။ လက်အမူအရာတွေအများကြီးပါပြီး ပြောတတ်တာမို့ဘေးနားကသူကတော့ ဟားဟားဆိုတစ်ချက် သိလားဆိုနောက်တစ်ချက် ဟုတ်တယ်မှန်တယ်ဆိုတစ်ချက် အဆွဲခံရတတ်ပါတယ်။ လက်လည်းအြန်သလိုပါးစပ်လေးကလည်း အသွက်လေးပါပဲ။ စကားပြောလည်းမြန်ပြီး rapper တွေရဲ့ပိုးများပါလာလားထင်ရတယ်။ ပြောပြီးဆိုရင်တောက်လျှောက်ကိုပြောတာအဆက်မပြတ် သူကတော့မသိဘူးဘေးလူတွေဖို့တော့ နားမလည်ကျတာများတယ်။ ပြီးတော့အကြောင်းအရာအများကြီးကို ဆက်ပြီးပြောတော့နားထောင်တဲ့သူတွေက အရှေ့ကဟာကိုနားလည်ဖို့ကြိုးစားတုန်း သူကအသစ်ပြောနေတော့ချာလည်လည်ကုန်ရော။\r\n\r\n\uD83D\uDC0Fစကားပွကြတဲ့သူတွေပေါ့လေ 